import React from 'react';
import './Logo.css';
import logoImage from '../images/icons/Logo.png';

function Logo() {
  return (
    <div className="logo-container">
      <div className="logo">
        <img src={logoImage} alt="Beznet" className="logo-image" />
      </div>
    </div>
  );
}

export default Logo;
